import Link from 'next/link';

const Aside = () => {
    return (
        <div className="side-bar">
            <aside>
                <Link href="/">
                    <a className="link">Home</a>
                </Link>
                <Link href="/about">
                    <a className="link">About</a>
                </Link>
            </aside>
            <footer>
                <div>Copyright Next App</div>
            </footer>

            <style jsx>{`
                .link {
                    display: block;
                }
                .side-bar {
                    min-width: 200px;
                    margin: 0 20px 0 0;
                }
                footer div {
                    font-size: 10px;
                }
            `}</style>
        </div>
    );
}

export default Aside;
